import Home from "./pages/home";
import About from "./pages/about";
import "./App.css";
import { BrowserRouter, Route, Routes, Router } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
